let carPoint = [113.3228084, 22.973722];

let roadWidth = 12;
let roadPixel = 100;

export function getXYRate(carPoint) {
  function getBiaPixel(roadPointArr, carPoint) {
    let distanceArr = [];

    for (let i = 0; i < roadPointArr.length; i++) {
      let d_pow2 =
        Math.pow(Math.abs(carPoint[0] - roadPointArr[i][0]), 2) +
        Math.pow(Math.abs(carPoint[1] - roadPointArr[i][1]), 2);
      distanceArr.push({ d_pow2: d_pow2, index: i });
    }
    distanceArr.sort((a, b) => a.d_pow2 - b.d_pow2);
    let [p1, p2] = [
      roadPointArr[distanceArr[0].index],
      roadPointArr[distanceArr[1].index],
    ];

    function calculateDistance(c, p1, p2) {
      const p1p2Length = Math.sqrt((p2[0] - p1[0]) ** 2 + (p2[1] - p1[1]) ** 2);
      const dotProduct =
        ((c[0] - p1[0]) * (p2[0] - p1[0]) + (c[1] - p1[1]) * (p2[1] - p1[1])) /
        p1p2Length ** 2;

      let projectionX, projectionY;
      if (dotProduct <= 0) {
        projectionX = p1[0];
        projectionY = p1[1];
      } else if (dotProduct >= 1) {
        projectionX = p2[0];
        projectionY = p2[1];
      } else {
        projectionX = p1[0] + dotProduct * (p2[0] - p1[0]);
        projectionY = p1[1] + dotProduct * (p2[1] - p1[1]);
      }

      const distance = Math.sqrt(
        (c[0] - projectionX) ** 2 + (c[1] - projectionY) ** 2
      );
      return { distance, projectionX, projectionY };
    }

    // 计算距离
    const distanceObj = calculateDistance(carPoint, p1, p2);
    const distance = distanceObj.distance;
    let o = [distanceObj.projectionX, distanceObj.projectionY];

    let biaPixel = (distance / roadWidth) * roadPixel;
    return { biaPixel, p1, index: distanceArr[0].index, o };
  }

  let obj = getBiaPixel(roadPointArr, carPoint);
  let index = obj.index;
  let rate = index / roadPointArr.length;
  let sign = carPoint[1] - obj.o[1];
  let nowY =
    sign > 0 ? roadPixel / 2 + obj.biaPixel : roadPixel / 2 - obj.biaPixel;
  function getDistance(lng1, lat1, lng2, lat2) {
    var radLat1 = (lat1 * Math.PI) / 180.0;
    var radLat2 = (lat2 * Math.PI) / 180.0;
    var a = radLat1 - radLat2;
    var b = (lng1 * Math.PI) / 180.0 - (lng2 * Math.PI) / 180.0;
    var s =
      2 *
      Math.asin(
        Math.sqrt(
          Math.pow(Math.sin(a / 2), 2) +
          Math.cos(radLat1) * Math.cos(radLat2) * Math.pow(Math.sin(b / 2), 2)
        )
      );
    s = s * 6378.137; // EARTH_RADIUS;
    s = Math.round(s * 10000) / 10000; //输出为公里
    var distance = s;
    var distance_str;
    if (parseInt(distance) >= 1) {
      distance_str = distance.toFixed(1) + "km";
    } else {
      distance_str = distance * 1000 + "m";
    }
    // 输出为米
    return s * 1000;
  }
  let carYBiasMeter = getDistance(obj.o[0], obj.o[1], carPoint[0], carPoint[1]);
  let carYRate =
    (sign > 0 ? roadWidth / 2 + carYBiasMeter : roadWidth / 2 - carYBiasMeter) /
    roadWidth;
  // console.log(obj, rate, nowY, obj.o);
  // console.log(carYBiasMeter);
  // console.log(carYRate);
  return { longRate: rate, widthRate: 1 - carYRate }
}
